import{_ as e,o as a,c as l,a as i}from"./app-D4ksCkgp.js";const s="/avatar.jpg",t={},n=i('<h1 id="about-nibbles" tabindex="-1"><a class="header-anchor" href="#about-nibbles"><span>About Nibbles</span></a></h1><p>欢迎来到Nibbles Blog~ 以下是我的个人简介</p><h2 id="nibbles-尼布" tabindex="-1"><a class="header-anchor" href="#nibbles-尼布"><span>Nibbles 尼布</span></a></h2><img src="'+s+'" alt="avatar" style="zoom:25%;"><p>座右铭就是首页下面的三块，一句话概括：</p><p><strong>个人繁荣，团队中的Linker，向终生成长者迈进！</strong></p><hr><p>16Personalities测试人格类型：ISTJ 我会有点内向，性格敏感，希望能慢慢成长为情绪稳定的人。 平时多QQ和微信文字交流~语音和视频暂时还是无法自然交流。有一手比较好看的字。</p><p>超级乐于助人，所以被推举成为一名团员。有时多帮别人解决些电脑的疑难杂症。有个超级强大的资源库，如果需要啥资源的话欢迎来找我~</p><p>此生只爱Minecraft(我的世界)，五年老玩家，三年服主，游戏技术自认一般（有段时间没玩会有点生疏），不过联机、教程一类欢迎咨询我，博客未来也会开专栏做MC相关的内容。</p><p>目前正在浅学平面设计，装修下博客。还有学习计算机相关的内容</p><h2 id="计算机技术" tabindex="-1"><a class="header-anchor" href="#计算机技术"><span>计算机技术</span></a></h2><p>曾自己简单学习计算机网络技术和程序设计与程序开发，也有云计算运维等有部分学习。</p><p>课余时间考取《云服务器ECS入门》和《网站建设：部署与发布》的阿里云Apsara Clouder专项技能认证（有效至2025.3.10）</p><p>目前会用的技术（语言、框架、运维、引擎）：</p><ul><li>HTML CSS</li><li>Python（含Flask）</li><li>PHP（熟练使用WordPress Xenforo Discuz程序）</li><li>SQL基本操作（MySQL、SQLite）</li><li>Docker部署与运维</li><li>Git版本控制</li></ul><p>在未来，待技术实力成熟之时，我希望能助力于开源社区！以及做出一款大家认可的良心软件！</p><h2 id="学习经历" tabindex="-1"><a class="header-anchor" href="#学习经历"><span>学习经历</span></a></h2><h3 id="高中时期" tabindex="-1"><a class="header-anchor" href="#高中时期"><span>高中时期</span></a></h3><p>曾任<strong>团支书、班长</strong>等职务，且均获得评优评先的荣誉，如<strong>优秀团支书、优秀干部等</strong>，多次推选到市级区级的征文或论文比赛且取得佳绩。</p><h3 id="高考后-——-树成林-·-浪前" tabindex="-1"><a class="header-anchor" href="#高考后-——-树成林-·-浪前"><span>高考后 —— 树成林 · 浪前</span></a></h3><p>在树成林教育科技集团有限公司的浪前预备营中，</p><ul><li>在数百人的点评小助手竞选中拔得头筹获“<strong>最强小助手</strong>”荣誉。</li><li>并参与结营答辩活动，并担任文案负责人，团队协作，成为Linker，最终链接团队在数百组的作品竞选中脱颖而出获得答辩初赛<strong>三等奖</strong>。</li><li>之后在数千人的复盘总结文章投稿中获“<strong>最佳复盘奖</strong>”荣誉，能够复盘才会翻盘！</li></ul><h2 id="联系方式" tabindex="-1"><a class="header-anchor" href="#联系方式"><span>联系方式</span></a></h2><p>见首页下拉博客右栏</p>',25),r